import React from "react";


var Result = React.createClass({
  render: function() {
    return (

      <div style={{width: '300px', margin: 0, padding: 0, border: 0}}><iframe src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300" border={0} cellSpacing={0} style={{width: '300px', height: '300px', margin: 0, padding: 0, overflow: 'hidden', border: 0}} frameBorder={0} /><div style={{fontSize: 'x-small', fontFamily: 'Arial, Tahoma, sans-serif', textAlign: 'right', width: '300px', margin: 0, padding: 0}}><a style={{textDecoration: 'none', color: '#999999'}} href="http://www.budgetyourtrip.com?r=widget" target="_blank">Budget Your Trip</a></div></div>
    );
  }


});

export default Result;
